import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const OpenComplaints = ({is_yetkili}) => {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    const getComplaints = async () => {
      try {
        let response;
        if (is_yetkili) {
          response = await axios.get('http://localhost:5000/complaints/open');
        } else {
          response = await axios.get('http://localhost:5000/complaints');
        }
        setComplaints(response.data.complaints);
      } catch (error) {
        console.error(error);
      }
    };
    getComplaints();
  }, [is_yetkili]);
  
  return (
    <>
    <div>
      <h1 className='centerdiv'>{is_yetkili ? 'Açık Arızalar' : 'Kullanıcı Arızaları'}</h1>
      <br></br>
      <table className='tablo'>
        <thead>
          <tr>
            <th className='tabloBasligi'>Arıza No</th>
            <th className='tabloBasligi'>Başlık</th>
            <th className='tabloBasligi'>Statü</th>
            <th className='tabloBasligi'>Detayları Gör</th>
          </tr>
        </thead>
        <tbody>
          {complaints.map((complaint) => (
            <tr className='tabloİcerik' key={complaint.id}>
              <td className='tabloİcerik' >{complaint.id}</td>
              <td className='tabloİcerik' >{complaint.title}</td>
              <td className='tabloİcerik' >{complaint.status}</td>
              <td className='tabloİcerik' >
                <Link to={`/complaint/${complaint.id}`}><img className='kucukikon' src={eye} alt='' /></Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      
    </div>
  <Link to="../solved-complaints"><button  className='buton button center' >Çözümlenmiş Arızaları Gör</button></Link>
  </> );


};

export default OpenComplaints;
